  - icon: /nix/store/7j21ks0fgsx1vbpigkc044i4ahbr7s9p-default_icon_64x64.png
    display_name: ZSH 5.9
    args:
      - /nix/store/qga3x88101vnrmwcpyc3akb99rg9bhp5-zsh-5.9/lib/codedown/shell
  - icon: /nix/store/48djih8q69y4pj097mx75rqwlh4y2rzz-haskell-logo-64x64.png
    display_name: GHCi 9.0.2
    args:
      - /nix/store/g4vdahbiz1hzkfcsjdz45rf0mpzqhqx6-ghc-9.0.2-with-packages/bin/ghci
exporter_infos: []
language_server_infos:
  - description: Integrates other language servers into the notebook.
    display_name: Notebook LSP Server
    primary: true
    is_built_in: true
    name: notebook
    extensions:
      - md
      - ipynb
    attrs: []
    type: stream
    args: []
    notebook_suffix: ''
  - icon: /nix/store/iv0l66606331c2463l17avxrk4j2wjai-pen-alt.png
    file: /nix/store/0n759j8bkfdj0a8n2x0rspc3hpganyyb-codedown-environment/lib/codedown/language-servers/codedown-spellchecker.yaml
    name: spellchecker
    extensions:
      - md
      - ipynb
    attrs:
      - markdown
    type: stream
    args:
      - /nix/store/q8g7vx57mr17j44dh3bqghlzccl57wfk-markdown-spellcheck-lsp-wrapped/bin/markdown-spellcheck-lsp
      - --affix-file
      - /nix/store/4xlm87nhfk97vz7ly90jpngfc4b8fhfw-hunspell-dict-en-us-wordlist-2018.04.16/share/hunspell/en_US.aff
      - --dic-file
      - /nix/store/4xlm87nhfk97vz7ly90jpngfc4b8fhfw-hunspell-dict-en-us-wordlist-2018.04.16/share/hunspell/en_US.dic
      - --stdio
    notebook_suffix: .spellchecker
  - description: LSP server for GHC
    display_name: Haskell Language Server
    icon: /nix/store/y2d3g6zcclla87vcivg9p3ywnb388zgy-icon_64x64.png
    primary: true
    kernel_name: haskell-ghc90
    env: {}
    file: /nix/store/0n759j8bkfdj0a8n2x0rspc3hpganyyb-codedown-environment/lib/codedown/language-servers/haskell-haskell-ghc90-hls.yaml
    name: haskell-language-server
    extensions: []
    attrs:
      - haskell
    type: stream
    args:
      - /nix/store/3rlzhjqb5kx87w08c2iyjhmwiw715pws-haskell-notebook-language-server-0.1.0.0/bin/haskell-notebook-language-server
      - --wrapped-hls
      - /nix/store/kb4mp8ryll3hqkf208z8k7iiyi81ms0y-haskell-language-server-1.10.0.0-wrapped/bin/haskell-language-server
      - --hls-args
      - --lsp
    notebook_suffix: ''
mode_infos:
  - code_mirror_mode: htmlmixed
    code_mirror_mime_type: text/html
    attrs:
      - html
    extensions:
      - htm
      - html
  - code_mirror_mode: haskell
    file: /nix/store/0n759j8bkfdj0a8n2x0rspc3hpganyyb-codedown-environment/lib/codedown/modes/haskell.yaml
    attrs:
      - haskell
      - haskell-ghc90
    extensions:
      - hs
